<script type="text/glsl" id="shaderPhong.vs">
uniform mat4 uProjection; 
uniform vec3 uCameraPosition; 
uniform vec3 uLightPosition; 

uniform float uMaterialDiffus;
uniform float uWorldIllum;
uniform float uMaterialIllum;
uniform float uMaterialSpecular; 
uniform float uLightStrength; 

uniform mat4 uModelview;

attribute vec4 aVertex;
attribute vec4 aNormal; 
attribute vec2 aTextureCoordinate; 

varying float intensity; 
varying vec2 textureCoordinate; 

const float exponent = 64.0; 

float calcDiffus(float Iin, float kDiff, vec3 L, vec3 N) {
	return Iin * kDiff *  max(0.0, dot(L, N)); 
}

vec3 calcReflection(vec3 L, vec3 N) {
	return L - 2.0 * dot(L, N) * N;
}

void main() {
	vec4 P = uProjection * uModelview * aVertex; 
	vec3 L = normalize(uLightPosition - P.xyz); 
	vec3 N = normalize((uProjection * uModelview * aNormal).xyz); 

	float IAmbient = uWorldIllum * uMaterialIllum; 
	float IDiffus = calcDiffus(uLightStrength, uMaterialDiffus, L, N); 
	vec3 R = calcReflection(normalize(uLightPosition), N); 
	float ISpecular = uLightStrength * uMaterialSpecular * max(0.0, pow(dot(R, uCameraPosition), exponent));

	intensity = IAmbient + IDiffus + ISpecular; 
	textureCoordinate = aTextureCoordinate; 
	gl_Position = P; 
}
</script> 

<script type="text/glsl" id="shaderPhong.fs">
precision mediump float;

uniform sampler2D uTexture; 

varying float intensity; 
varying vec2 textureCoordinate; 

void main() {
	vec4 color = texture2D(uTexture, textureCoordinate);
	gl_FragColor = color * intensity; 
}
</script> 



<script type="text/glsl" id="shader.vs">
attribute vec4 vPosition;
attribute vec2 vTextureCoord;

uniform mat4 vModelView;
uniform mat4 vProjection; 
uniform mat4 vEye; 

varying vec2 textureCoord;

void main() {
	textureCoord = vTextureCoord; 
	gl_Position = vProjection * vModelView * vPosition;
}
</script>
